import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
    return (
      <body>
        <header class="header">
          <h1>Добро пожаловать в терминал для оплаты мобильной связи</h1>
        </header>
        <main>
          <ul class="list__of-item">
            <li class="item__wrapper">
              <a>МТС</a>
            </li>
            <li class="item">
              <a>Мегафон</a>
            </li>
            <li class="item">
              <a>Билайн</a>
            </li>
          </ul>
        </main>
        <footer class="footer">Тестовое задание</footer>
      </body>
    );
}

export default App;
